# First : Import Pandas and NumPy and other usual packages
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
import matplotlib as mpl
import seaborn as sns

"""*These are the **23** columns and what they satnd for:*

***Season***->Match Season

***DateTime***->Match Date and Time (yyyy-mm-dd hh:mm:ss)

***HomeTeam***->Home Team / **AwayTeam**->Away Team

**FTHG**->Full Time Home Team Goals / **FTAG**->Full Time Away Team Goals

**FTR**->Full Time Result (H=Home Win, D=Draw, A=Away Win)

**HTHG**->Half Time Home Team Goals / **HTAG**->Half Time Away Team Goals

**HTR**->Half Time Result (H=Home Win, D=Draw, A=Away Win)

**Referee**->Match Referee / **HS**->Home Team Shots / **AS**->Away Team Shots

**HST**->Home Team Shots on Target / **AST**->Away Team Shots on Target

**HC**->Home Team Corners / **AC**->Away Team Corners

**HF**->Home Team Fouls Committed / **AF**->Away Team Fouls Committed

**HY**->Home Team Yellow Cards / **AY**->Away Team Yellow Cards

**HR**->Home Team Red Cards / **AR**->Away Team Red Cards
"""

# Commented out IPython magic to ensure Python compatibility.
# Let's read in a CSV file from GitHub.
# %time

#Have to encode 'mac_latin2' due to non-English characters
url = 'https://raw.githubusercontent.com/colinHarrell/EPL-data-set-1993-94-to-2021-22/main/results.csv'
soccer = pd.read_csv(url, encoding='mac_latin2')
soccer.head()

#Numerical discriptors
soccer.describe()

#Info of the raw data(Original)
soccer.info()

#Info of the raw data(Efficient).

soccer = soccer.astype({'DateTime' :'datetime64'})

soccer = soccer.astype({'Season'   : 'category',
                        'HomeTeam' : 'category',
                        'AwayTeam' : 'category',
                        'FTR'      : 'category',
                        'HTR'      : 'category',
                        'Referee'  : 'category'})

soccer = soccer.astype({'FTHG'     : 'int32',
                        'FTAG'     : 'int32'})

soccer = soccer.astype({'HTHG'     : 'float16',
                        'HTAG'     : 'float16',
                        'HS'       : 'float32',
                        'AS'       : 'float32',
                        'HST'      : 'float16',
                        'AST'      : 'float16',
                        'HC'       : 'float16',
                        'AC'       : 'float16',
                        'HF'       : 'float32',
                        'AF'       : 'float32',
                        'HY'       : 'float16',
                        'AY'       : 'float16',
                        'HR'       : 'float16',
                        'AR'       : 'float16'})

soccer.info()

#After changes are made to sizes of columns.
soccer.describe()

#Shows how the data looks after changes were made.
soccer.head()

