#This chart will be total yellow vs total red.
#There are far more yellows because to obtain a red,
#a player must commit a very hard foul, which is rare.
cards = ['All_Yellows' ,'All_Reds']
count = [11736+14477 , 521+741]
colors =['Yellow', 'Red']
plt.pie(count, labels=cards, colors = colors)
plt.show()

