#The colors have been changed to indicate the difference.
#The away team was more disiplined overall. Home field advantage maybe?!
cards = ['HomeYellow' ,'AwayYellow' ,'HomeRed' ,'AwayRed']
count = [11736 ,14477 ,521 ,741]
colors =['Yellow', 'gold','Red', 'firebrick']
plt.pie(count, labels=cards, colors = colors)
plt.show()

